import React from "react";

function Footer() {
  return (
    <div className="flex flex-col w-full items-center justify-items-center bg-gray-300 h-60">
      <div className="flex flex-row w-11/12 h-full">
        <div className=" flex flex-col h-full w-3/12 items-center pt-3 bg-green-400">
          <h3 className="font-bold text-xl">Search & Book</h3>
          <ul className="text-ms text-green-50 font-bold">
            <li>Packages</li>
            <li>Flights</li>
            <li>Trains</li>
            <li>Bus</li>
            <li>Hotels</li>
          </ul>
        </div>
        <div className="h-full w-3/12 bg-red-400"></div>
        <div className="h-full w-3/12 bg-blue-400"></div>
        <div className="h-full w-3/12 bg-purple-900"></div>
      </div>
    </div>
  );
}

export default Footer;
